import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TablePagination from '@mui/material/TablePagination';
import TableRow from '@mui/material/TableRow';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import Checkbox from '@mui/material/Checkbox';
import IconButton from '@mui/material/IconButton';
import Tooltip from '@mui/material/Tooltip';
import DeleteIcon from '@mui/icons-material/Delete';
import AddIcon from '@mui/icons-material/Add';
import { alpha } from '@mui/material/styles';
import TableSortLabel from '@mui/material/TableSortLabel';
import { styled } from '@mui/material/styles';
import TextField from '@mui/material/TextField';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: "#DDDDDD",
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
    fontColor: "black"
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));


function EnhancedTableHead(props) {
    const {
      onSelectAllClick,
      order,
      orderBy,
      numSelected,
      rowCount,
      onRequestSort,
    } = props;
    const createSortHandler = (property) => (event) => {
      onRequestSort(event, property);
    };
  
    return (
      <TableHead>
        <StyledTableRow>

          {props.columns.map((headCell) => (
            <StyledTableCell
              sx={{minWidth: headCell.minWidth}}
              key={headCell.id}
              align={headCell.numeric ? 'right' : 'left'}
              >
                <Typography variant="subtitle1"><b>{headCell.label}</b></Typography>
                
            </StyledTableCell>
          ))}
        </StyledTableRow>
      </TableHead>
    );
  }
  
  const EnhancedTableToolbar = (props) => {
  
    return (
      <Toolbar
      style={{ background: '#222222' }}
        sx={{
          pl: { sm: 2 },
          pr: { xs: 1, sm: 1 },
        }}
      >
        <Typography
          color="white"
            sx={{ flex: '1 1 100%' }}
            variant="h6"
            id="tableTitle"
            component="div"
          >
            Variables
          </Typography>
  
          <Tooltip title="New Surface">
            <IconButton onClick={props.handleCreateRow}>
              <AddIcon />
            </IconButton>
          </Tooltip>
      </Toolbar>
    );
  };
  
  const columns = [
    { id: 'symbol', label: 'Symbol', minWidth: 50 },
    { id: 'label', label: 'Label', minWidth: 300 },
    { id: 'type', label: 'Type', minWidth: 300 },
  ];
  
  export default function CustomInputTable(props) {
    const [page, setPage] = React.useState(0);
    const [rowsPerPage, setRowsPerPage] = React.useState(10);
    const [selected, setSelected] = React.useState([]);
  
    const [order, setOrder] = React.useState('asc');
    const [orderBy, setOrderBy] = React.useState('calories');
  
  
    const handleDelete = (selectedList) => {
      props.handleDelete(selectedList);
      setSelected([]);
    };
    
    return (
      <Paper sx={{ width: '100%', overflow: 'hidden' }}>
        <TableContainer style={{border: "1px solid grey"}} sx={{ maxHeight: 440 }}>
          <Table stickyHeader  size="small" aria-label="sticky table">
            <EnhancedTableHead
              columns={columns}
            />
            <TableBody>
              {props.rows.map((row, index) => {
                  return (
                    <StyledTableRow
                      hover
                      tabIndex={-1}
                      key={row.id}
                    >
                    {columns.map((column) => {
                      const value = row[column.id];
                      return (
                        <StyledTableCell key={column.id} align={column.align}>
                          <TextField id="standard-basic" variant="standard" />
                        </StyledTableCell>
                      );
                    })}

                      
                    </StyledTableRow>
                  );
                })}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>
    );
  }
